import React from 'react';
import { Link } from "react-router-dom";
export default function Error() {
    return (
        <main>
            <section id="oops">
                <div class="logoDv">
                    <a href="https://blootopia.com/beta/"><img src="https://blootopia.com/beta/uploads//images/cybersec-prep-logo1.svg?v-31" alt="" /></a>
                </div>
                <div class="contain text-center">
                    <div class="icon">404</div>
                    <div class="inner">
                        <h4>Page Not Found</h4>
                        <p>Let's pretend ..... !! You never saw that. Go back to the Homepage to find out more.</p>
                        <div class="bTn"><a href="https://blootopia.com/beta/" class="webBtn">Back to the website</a></div>
                    </div>
                </div>
            </section>
        </main>
    );
}
